import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { HeaderComponent } from './header/header.component';
import { HomeComponent } from './home/home.component';
import { FooterComponent } from './footer/footer.component';
import { CategoriesComponent } from './categories/categories.component';
import { AboutComponent } from './about/about.component';
import { ActionComponent } from './categories/action/action.component';
import { PageActionComponent } from './page-action/page-action.component';
import { PageHorrorComponent } from './page-horror/page-horror.component';
import { PageComedyComponent } from './page-comedy/page-comedy.component';

@NgModule({
  declarations: [
    AppComponent,
    HeaderComponent,
    HomeComponent,
    FooterComponent,
    CategoriesComponent,
    AboutComponent,
    ActionComponent,
    PageActionComponent,
    PageHorrorComponent,
    PageComedyComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
